import React, { Component } from 'react';
import Projects from'./Components/projects';
import './App.css';
class App extends Component {

  constructor()
  {
  	super();
  	this.state={
  		projects:[
  		{
  			title:'a',
  			name:'aa'
  		},
  		{
  			title:'b',
  			name:'bb'
  		},
  		{
  			title:'c',
  			name:'cc'
  		}
  		]
  	}
  }
  render() {
    return (
      <div className="App">
       My App
       <Projects projects/>
      </div>
    );
  }
}

export default App;
